import './App.css';
let index = 334443128;
let baseUrl = `https://cdn3.riastatic.com/photosnew/auto/photo/__${index}f.jpg`;
const App = () => {

  return (
    <>
        <div className='Car_app'>
            <img src={baseUrl} alt=""/>
            <div className='Car_app_align_button'>
                <button onClick={()=>index--}>Left</button>
                <button onClick={()=>index++}>Right</button>
            </div>

        </div>

    </>
  );
}

export default App;
